import { Box, Container, Flex } from "@chakra-ui/core";
import { Link } from "react-router-dom";
import { useState } from "react";
import React from "react";
import AddNewPost from "./add-new-post";

const Navbar = () => {
   return (
    <div className="w-screen h-fit shadow-sm">
      <div className="flex flex-row justify-between pr-4 pl-4">
        <div className="p-4">
          <h1 className="text-2xl text-orange-500   font-semibold">
            <Link to="/"> Anonymous Messaging Web Application</Link>
          </h1>
        </div>
        <div className="flex flex-row gap-4 pr-4">
          <div className="text-gray-500 text-lg pt-4 pl-2 pr-2 hover:bg-gray-100">
            <Link to="/Communities">Communities</Link>
          </div>
          <div className="text-gray-500 text-lg pt-4 pl-2 pr-2 hover:bg-gray-100">
            <Link to="/Messaging">Messaging</Link>
          </div>
          <div className="text-gray-500 text-lg pt-4 pl-2 pr-2 hover:bg-gray-100">
            <Link to="/Statistics">Statistics</Link>
          </div>
          <div className="text-gray-500 text-lg pt-4 pl-2 pr-2 hover:bg-gray-100">
            <Link to="/Login">Login</Link>
          </div>
        </div>
      </div>
    </div>
  );
};

export default Navbar;
